  return (
    <> <div className="box">
       <div>{book.title}</div>
       <button className="button"><NavLink to={`/books/:${book.id}`}> Details </NavLink></button>
      {/* <div className="box">
            <div>Name: {name}</div>
            <div>Info: {info}</div>
            </div> */}
            </div>
    </>
  );
};

export default Book;
